exports.seed = function(knex, Promise) {
    // Deletes ALL existing entries
    return knex('imagen').del()
        .then(function() {
            // Inserts seed entries
            return knex('imagen').insert([{
                    nombreImagen: 'pastel3.jpg',
                    tipoImagen: 'image/jpeg',
                    contenidoImagen: '"'
                },
                {
                    nombreImagen: 'postre1.jpg',
                    tipoImagen: 'image/jpeg',
                    contenidoImagen: '',
                }
            ]);
        });
};